fetch('https://swapi.co/api/people/1/')
  .then((res) => {
    return res.json();
  })
  .then((body) => {
    console.log(body)
});


const getJson = async (url) => {
  const res = await (url);
  const body = await res.body;
  return body;
};

getJson('https://swapi.co/api/people/1/')
  .then((body) => {
    console.log(body)
  });
